INSERT INTO `arhive_post` (`id`, `headers`, `short_description`, `text_post`, `image`, `data_post`, `writers`) VALUES
(1, 'Изменения в оплате жировок: счета будут выставлять по новым тарифам уже с 1 июля.', 'Коммунальники в жировках за июль будут выставлять счета по новым тарифам. Напомним, в Беларуси пересмотрели порядок расчетов и внесения платы за жилищно-коммунальные услуги. Основные изменения вступили в силу с 1 июля, а отдельные — с 1 октября.', 'Какие изменения ввели с 1 июля\r\nТак, с 1 июля пересмотрели в сторону понижения тарифы на электроэнергию для тех, чьи жилые помещения не оборудованы системами центрального горячего водоснабжения и централизованного снабжения природным газом. Для данной категории норматив повышен до 250 кВт·ч. А при потреблении от 250 до 400 кВт·ч оплата также будет производиться по субсидируемым тарифам, но с применением повышающего коэффициента 1,3. По полному тарифу платить будут те, кто превысит лимит в 400 кВт·ч в месяц.\r\n\r\nЕще одно изменение — скидка на отопление в 10% в течение 3 лет для тех, кто за свой счет установит приборы индивидуального учета расхода тепловой энергии. А тем, у кого были установлены такие счетчики до 1 января этого года, но ими не пользовались, будет предоставлена скидка в 5% на отопление в течение 3 лет, если они начнут оплачивать по приборам. Эти льготы также ввели с 1 июля этого года.\r\n\r\nНеработающие пенсионеры, а также те, кто имеет право на льготы по оплате ЖКУ, или инвалиды 3-й группы с 1 июля могут оплачивать услуги электро- и газоснабжения по субсидируемым тарифам в двух жилых помещениях: по адресу обязательной регистрации по месту жительства и регистрации по месту пребывания. Причем второй адрес можно выбрать по желанию: неважно, что это — квартира в другом городе, дача или дом в садовом товариществе.\r\n\r\nЕще одно изменение касается хозяев индивидуальных домов, которые содержат скот и занимаются огородом. Они могут установить отдельный прибор учета потребления воды. Он будет контролировать расход воды именно на полив и содержание скота, и этот объем воды будет исключаться из платы за услугу водоотведения.\r\n\r\nЧто изменится с 1 октября\r\nС 1 октября собственники одноквартирных, блокированных жилых домов, в которых никто не прописан, смогут на 6 месяцев в календарном году приостанавливать оказание услуги по обращению с твердыми коммунальными отходами. Соответственно плата за эту позицию в жировке не будет начисляться.\r\n\r\nБелорусы, которые проживают в общежитии и заключили договор найма жилого помещения, с 1 октября будут обязаны вносить плату за водоснабжение, водоотведение, электрическую энергию. Это касается в том числе потребляемой электроэнергии на освещение вспомогательных помещений и работу оборудования, а также санитарного содержания вспомогательных помещений. То есть в обязательном порядке нужно будет платить за все услуги, которые начисляются в зависимости от количества проживающих.\r\n\r\nСейчас подобная обязанность фактически возлагалась только при регистрации в общежитии по месту жительства или по месту пребывания, что приводило к неоднозначным ситуациям.\r\n\r\nС октября начнет действовать новый порядок устранения допущенных исполнителем ошибок, в результате которых приходится дополнительно начислять плательщику определенные суммы. Доначисление возможно производить только за три месяца.\r\nНо срок давности остается прежним (три года) в случаях, если недостаточное начисление производилось по вине гражданина. Например, если поменялся собственник, а об этом не было своевременно сообщено.\r\nЧитать полностью:  https://finance.tut.by/news601786.html', , '2018-07-02', '');
INSERT INTO `arhive_post` (`id`, `headers`, `short_description`, `text_post`, `image`, `data_post`, `writers`) VALUES
(2, 'Исследование правозащитников: в Беларуси 103 тысячи человек живут в "современном рабстве"\r\n', 'Фонд Walk Free Foundation опубликовал свежий выпуск «Глобального индекса рабства». В антирейтинге Беларусь занимает 20-е место среди 167 стран. По данным правозащитников, 103 тысячи человек, или 1% населения страны, находятся в подневольном положении.', 'Фонд Walk Free Foundation опубликовал свежий выпуск «Глобального индекса рабства». В антирейтинге Беларусь занимает 20-е место среди 167 стран. По данным правозащитников, 103 тысячи человек, или 1% населения страны, находятся в подневольном положении.\r\nК современному рабству правозащитники относят принудительный труд, торговлю людьми, а также практики, которые связаны с рабством или похожи на него (например, брак без согласия). Под этот термин подпадают ситуации эксплуатации, в которых человек не может отказаться или уйти из-за угроз, насилия, принуждения, обмана или злоупотребления властью.\r\n\r\nПо сравнению с предыдущими годами количество находящихся в «современном рабстве» в нашей стране увеличилось более чем в два раза. В 2016 году правозащитники заявляли о 44,6 тысячи рабов в Беларуси, в 2013−2014 годах — о 11−12 тысячах.\r\n\r\nВсего в мире, по данным организации, в рабстве находятся 40,3 миллиона человек. 71% из них — женщины, 29% — мужчины. 15,4 миллиона человек оказались затронуты принудительными браками, 24,9 миллиона — трудятся не по своей воле.\r\n\r\nАктивнее всего с этим явлением борются власти Нидерландов, США, Великобритании, Швеции и Бельгии. Меньше всего — в КНДР, Ливии, Эритрее, ЦАР и Иране. Наибольшее количество рабов в Европе живет в России, Турции и Украине, антилидеры по доле людей в неволе — Туркменистан, Беларусь и Македония.\r\n\r\nСоставители доклада отмечают, что посчитать число жертв «современного рабства» нелегко, поскольку такие преступления носят скрытый характер. При составлении рейтинга учитывались 24 переменных, определяющих риск порабощения.\r\n\r\nЭти переменные характеризуют политические права и безопасность, финансовые и медицинские гарантии, защиту наиболее уязвимых групп населения и конфликты, происходящие в странах. Важной частью оценки стран являются меры противодействия рабству, принимаемые правительствами.\r\n\r\nВ 2016 году авторы рейтинга включили в оценку принуждение к труду со стороны государства. Под этим подразумевается угроза любого наказания за невыполнение работы, на которое население, или его часть, не соглашались добровольно. В докладе говорится, что принудительный труд практикуется в некоторых африканских странах, Узбекистане, Туркменистане, Таджикистане, Китае, КНДР, Вьетнаме, России и Беларуси.\r\n\r\nWalk Free Foundation — австралийская неправительственная организация, которая ежегодно составляет «Глобальный индекс рабства». Опросы в странах, включенных в рейтинг, проводит исследовательская компания Gallup.', , '2018-07-06', '');
INSERT INTO `arhive_post` (`id`, `headers`, `short_description`, `text_post`, `image`, `data_post`, `writers`) VALUES
(3, '"Для закрепления кадров на селе". Сельчанам разрешили выкупать занимаемое ими жилье\r\n', 'Александр Лукашенко подписал указ № 287 «О продаже жилых домов (квартир) в сельской местности», который создает дополнительные условия для закрепления кадров на селе. Об этом сообщает пресс-служба президента.\r\n', 'Александр Лукашенко подписал указ № 287 «О продаже жилых домов (квартир) в сельской местности», который создает дополнительные условия для закрепления кадров на селе. Об этом сообщает пресс-служба президента.\r\nСогласно указу, гражданам разрешено приобретать занимаемые ими жилые помещения у организаций жилищно-коммунального хозяйства, которым эти помещения были переданы при реализации указов по финансовому оздоровлению сельскохозяйственных предприятий.\r\n\r\nДокумент также освобождает сельхозорганизации от налогообложения по операциям, связанным с переводом на соответствующие райисполкомы долга по льготным кредитам, полученным на строительство, реконструкцию и приобретение жилых домов или квартир.', , '2018-07-23', '');
INSERT INTO `arhive_post` (`id`, `headers`, `short_description`, `text_post`, `image`, `data_post`, `writers`) VALUES
(4, 'Возможно, Илон Маск выпустит смартфон\r\n', 'Компания Tesla, занимающаяся выпуском электрокаров и возглавляемая Илоном Маском, выпустит смартфон. Фотографии его задней и передней панелей сегодня попали в Сеть, пишет Gizchina.', 'Компания Tesla, занимающаяся выпуском электрокаров и возглавляемая Илоном Маском, выпустит смартфон. Фотографии его задней и передней панелей сегодня попали в Сеть, пишет Gizchina.\r\nПервая информация о возможности выпуска Tesla смартфона под названием Quadra появилась еще в ноябре прошлого года. Судя по изображениям, аппарат получит дисплей с «козырьком» в верхней части, а на задней стороне расположится большой логотип компании и вырез для сдвоенной основной камеры. Там же можно заметить длинную горизонтальную полосу снизу — возможно, она нужна для мультимедийного спикера.\r\n\r\nБолее подробной информации о технических характеристиках, стоимости или дате анонса аппарата пока нет. Отметим, что в портфолио компании уже есть портативный аккумулятор емкостью в 3350 мАч.', , '2018-07-12', '');

